window.bookSummaryJSON = "<p><i>Passion, peril, and a princess in hiding... </i></p> <p>Forced into hiding after a threat to her life, Princess Gabriella St. Pierre must protect both herself and her unborn child. Working at an orphanage, the princess tries to suppress memories of a passionate night long ago with Whit Howell - her father's royal bodyguard and a man she never thought she'd see again. </p> <p>When an attempted abduction occurs as Princess Gabriella is leaving the orphanage, Whit rescues her and vows to keep her safe. But how can he shepherd the princess back to her country without knowing who is orchestrating these attacks...and why? It is the most important mission of his life - and he'd risk everything to save the one woman he can't live without.</p>"; 
